import { SET_TOKEN } from './actionTypes';

const DashboardReducer = (state, action) => {
    const { type, payload } = action;

    switch (type) {
        case SET_TOKEN:
            return {
                ...state,
                token: payload,
            }
        default:
            return state;
    }
}

export default DashboardReducer;
